import "./Navbar.css"
import styled from 'styled-components'
import React, { useState } from 'react';
import {Link} from 'react-router-dom';

import Home from '../Home/Home';
import About from '../IceCream/IceCream';
import IceCream from '../IceCream/IceCream';

//back out .., into home and then home 




function Navbar() {

    const [currentPage, setCurrentPage] = useState('home'); // State to track the current page

    // Render the appropriate page component based on the current page state
    const renderPage = () => {
      switch (currentPage) {
        case 'home':
          return <Home />;
        case 'about':
          return <About />;
        case 'icecream':
          return <IceCream />;
        default:
          return <Home />;
      }
    };

    return (
        <div>
            {/* Your existing navbar */}
            <nav class="taskbar">
                <ul>
                    <li><Link to="/Home">Home</Link></li>
                    <li><Link to="/About">About</Link></li>
                    <li><Link to="/IceCream">IceCream</Link></li>
                </ul>
            </nav>



            {/* Render the selected page */}
            {renderPage()}
        </div>
    );


}

export default Navbar;
